export default ()=>{
    console.log(NAVBAR_ITEMS)
return <Header className="header">
  <div className="logo" />
  <Menu theme="dark" mode="horizontal"  style={{ float:'right' }} defaultSelectedKeys={['1']}>
{
  NAVBAR_ITEMS.map((item,index)=>{
  return <Item key={index}>{item.displayName}</Item>
  })
}
  </Menu>
</Header>
}
